import React from 'react';

const EmailCard = () => {
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">Email</h5>
        <p className="card-text">Email address goes here.</p>
      </div>
    </div>
  );
};

export default EmailCard;
